query InitialProductFilterData($categories: [ID!], $collections: [ID!], $productTypes: [ID!]) {
  attributes(first: 100, filter: {filterableInDashboard: true}) {
    edges {
      node {
        id
        name
        slug
        values {
          id
          name
          slug
          __typename
        }
        __typename
      }
      __typename
    }
    __typename
  }
  categories(first: 100, filter: {ids: $categories}) {
    edges {
      node {
        id
        name
        __typename
      }
      __typename
    }
    __typename
  }
  collections(first: 100, filter: {ids: $collections}) {
    edges {
      node {
        id
        name
        __typename
      }
      __typename
    }
    __typename
  }
  productTypes(first: 100, filter: {ids: $productTypes}) {
    edges {
      node {
        id
        name
        __typename
      }
      __typename
    }
    __typename
  }
}
